import React from 'react';

function Images({flex , hover}) {

    return (
        <div style={{
            borderRadius:"20px",
            height:"20rem",
            flex:flex,
            marginLeft:"0.5rem",
            marginRight:"0.5rem",
            marginBottom:"20px",
            overflow:"hidden"
        }}>
            <img style={{
                width:"100%",
                height:"100%"
            }} src={"https://cdn.pixabay.com/photo/2015/04/23/22/00/tree-736885__480.jpg"}>

            </img>
        </div>
    );
}

export default Images;
